  async componentDidMount() {
    const data = await fetchData();
    console.log(data);

  }

  render(){
    return(
      <div className = "container bg-dark">
      <Cards/>
      <Chart/>
      <CountryPicker/>
      </div>
    )
  }
}

export default App;
